import React from 'react';
import './LandingPage.css';
import PropertyCard from '../PropertyCard/PropertyCard';
import airbnbData from '../../dataset/dataset_airbnb.json';

const airbnb_dataset = JSON.parse(JSON.stringify(airbnbData));
const all_property_cards = []

function LandingPage() {
  console.log(airbnb_dataset);
  airbnb_dataset.forEach(element => {
    all_property_cards.push(
      <PropertyCard 
        name={element.name}
        price={element.pricing.rate}
        image_url={element.photos[0].pictureUrl}
      ></PropertyCard>)
    });

  return (
    <div>
      <div className='p-5 mt-5 flex justify-center'>
        <div className='grid grid-cols-3 gap-12'>
          {all_property_cards}
        </div>
      </div>
    </div>
  )
}

export default LandingPage;
